import React from 'react';
function About() {
  return (
    <>
      <div class="row">

<h2 class="text-center">About Us</h2>
</div>

<div class="col-md-8">
<p class="about-us-content text-justify">The RB Group of Companies offers excellence in forging, machining, gear cutting and assemblies. Formed in 1993, the RB Group has grown steadily, initially within India and became International in 2015 with the acquisition of Shakespeare Forgings Limited in the U.K. The RB Group offers experience, expertise and execution in forged products offering a one-stop shop for forged engineered parts, forged gears, machined forgings and assemblies.</p>

<p class="text-justify">The forging, machining and gear cutting plants are based in and around Chandigarh and North of Delhi. Shakespeare Forgings is based in Cradley Heath, W. Midlands, U.K. and acts both as a manufacturing base, finished engineering parts from its sister companies in India and as a warehousing and logistics facility for the groupâ€™s sales in Europe.The RB group supplies a wide range of high integrity, safety critical steel parts to a variety of key market sectors including automotive, petrochemical , rail and tractor manufacture.</p>
</div>

<div class="col-md-4">
<div class="about-us-img"><img src='/../public/img/about-us-img.jpeg'></img></div>

</div>
    </>
  );
}
export default About;
